import React from 'react';
import { Link } from 'react-router-dom'

const HistorySummary = ({ historyData, auth }) => {
    console.log('this is history data', historyData);
    return (
        <React-fragment>
            {historyData.id === auth.uid && <div style={{ overflow: 'auto' }}>
                <Link to={'/'}>
                    <span>{historyData.method} </span>
                </Link>
                <span>{historyData.url}</span>
                <button style={{ color: 'red' }} onClick={() => this.handleClick}>X</button>
            </div>}

        </React-fragment>
    );
};

export default HistorySummary;
